import React from 'react';

type TechStackProps = {
  t: {
    title: string;
  };
};

const logos = [
  {
    name: 'OpenAI',
    src: 'https://cdn.openai.com/logos/openai-mark.svg',
    alt: 'OpenAI',
    className: 'h-10 w-10',
  },
  {
    name: 'Tailwind CSS',
    src: 'https://tailwindcss.com/_next/static/media/tailwindcss-logomark.6f4676b2.svg',
    alt: 'Tailwind CSS',
    className: 'h-10 w-10',
  },
  {
    name: 'React',
    src: 'https://upload.wikimedia.org/wikipedia/commons/a/a7/React-icon.svg',
    alt: 'React',
    className: 'h-10 w-10',
  },
];

const TechStack: React.FC<TechStackProps> = ({ t }) => (
  <section className="w-full py-10 bg-white dark:bg-[#23272f] flex flex-col items-center transition-colors">
    <h2 className="text-xl font-semibold text-gray-700 dark:text-gray-200 mb-6">{t.title}</h2>
    <div className="flex flex-row gap-10 items-center justify-center">
      {logos.map((logo) => (
        <img
          key={logo.name}
          src={logo.src}
          alt={logo.alt}
          className={`${logo.className} transition-transform hover:scale-110`}
          style={{ filter: logo.name === 'OpenAI' ? 'invert(0)' : undefined }}
        />
      ))}
    </div>
  </section>
);

export default TechStack;
